    // Функция для фильтрации значений
    private static List<Integer> filterLengthValues(List<Integer> lengthValues) {
        double mean = calculateMean(lengthValues);
        double stdDev = calculateStandardDeviation(lengthValues, mean);

        // Определение границы фильтрации (например, 2 стандартных отклонения от среднего)
        double lowerBound = mean - 2 * stdDev;
        double upperBound = mean + 2 * stdDev;

        // Фильтрация значения, находящиеся в пределах границ
        List<Integer> filteredValues = new ArrayList<>();
        for (Integer value : lengthValues) {
            if (value >= lowerBound && value <= upperBound) { filteredValues.add(value);
            }
        }

        return filteredValues;
    }

    // Функция для расчета среднего значения
    private static double calculateMean(List<Integer> values) {
        double sum = 0;
        for (Integer value : values) {
            sum += value;
        }
        return sum / values.size();
    }

    // Функция для расчета стандартного отклонения
    private static double calculateStandardDeviation(List<Integer> values, double mean) {
        double sumSquaredDiff = 0;
        for (Integer value : values) {
            double diff = value - mean;
            sumSquaredDiff += diff * diff;
        }
        double variance = sumSquaredDiff / values.size();
        return Math.sqrt(variance);
    }
